import {PersonalTaskService} from "@entities/task";
import { useQuery } from "@tanstack/react-query";

export class PersonalTaskRepository {
    static async getList() {
        return await PersonalTaskService.getList();
    }

    static getList2 = async () =>
        useQuery;
}
